// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Voting {
    struct Candidate {
        uint id;
        string name;
        uint voteCount;
    }

    struct Poll {
        uint id;
        string title;
        address creator;
        uint creationTime;
        mapping(uint => Candidate) candidates;
        mapping(address => bool) voters; // Add this line
        uint candidatesCount;
    }

    uint public fee = 0.01 ether;
    uint public pollCount;
    mapping(uint => Poll) public polls;
    mapping(address => bool) public premiumUsers;

    event PollCreated(uint pollId, string title);
    event VotedEvent(uint pollId, uint candidateId);

    modifier onlyPremium() {
        require(premiumUsers[msg.sender], "Not a premium user");
        _;
    }

    function addPoll(string memory _title) public payable {
        require(msg.value == fee, "Incorrect fee amount");
        pollCount++;
        Poll storage newPoll = polls[pollCount];
        newPoll.id = pollCount;
        newPoll.title = _title;
        newPoll.creator = msg.sender;
        newPoll.creationTime = block.timestamp;

        emit PollCreated(pollCount, _title);
    }

    function addCandidate(uint _pollId, string memory _name) public onlyPremium {
        Poll storage poll = polls[_pollId];
        poll.candidatesCount++;
        poll.candidates[poll.candidatesCount] = Candidate(poll.candidatesCount, _name, 0);
    }

    function vote(uint _pollId, uint _candidateId) public {
        Poll storage poll = polls[_pollId];
        require(!poll.voters[msg.sender], "You have already voted"); // Check if the voter has already voted

        poll.voters[msg.sender] = true; // Mark the voter as having voted
        poll.candidates[_candidateId].voteCount++;

        emit VotedEvent(_pollId, _candidateId);
    }

    function subscribe() public payable {
        require(msg.value == 0.1 ether, "Incorrect subscription amount");
        premiumUsers[msg.sender] = true;
    }
}
